INSERT INTO `foto` VALUES (31, 41, 'Rumah Sakit Asri Medika', '53asri-medika.jpg', 'Rumah Sakit Asri Medika merupakan pusat pelayanan<br />kesehatan yang dilengkapi dengan fasilitas penunjang medis<br />serta Poliklinik Umum dan Klinik Dokter Spesialis yang<br />profesional dibidangnya sehingga dapat memberikan pelayanan<br />yang berkualitas kepada masyarakat.<br /><br />Di tengah persaingan dunia kesehatan saat ini, RS Asri Medika<br />selalu berbenah diri sehingga mampu menjawab segala ASRI kebutuhan masyarakat di bidang kesehatan.');
INSERT INTO `foto` VALUES (32, 41, 'Rumah Sakit Kartika Pulomas', '23kartika-pulomas.jpg', 'Rumah Sakit Akreditasi Tipe C ini merupakan prototipe<br />konsep pengelolaan Private Public Partnership<br />pertama di Indonesia yang menjadi solusi<br />permasalahan pengelolaan rumah sakit sehat di era<br />Jaminan Kesehatan Nasional (JKN) dengan<br />mengedepankan Layanan Rumah Sakit Hibrid Kartika<br />Pulomas Rumah Sakit berkomitmen untuk menjadi<br />fasilitas kesehatan yang dapat diakses tanpa batas');
INSERT INTO `foto` VALUES (33, 41, 'Rumah Sakit Umum Siti Hajar ', '74siti-hajar.jpg', 'Pendirian Rumah Sakit Umum Siti Hajar Medan diawali dengan pendirian dokter<br />praktek yang pelaksanaannya ditangani almarhum. Dr. HM. Mochtar Tarigan DSP,<br />yaitu sekitar tahun 1973, dengan pelayanan rawat jalan yang masih sederhana.<br />Dengan semakin meningkatnya kebutuhan masyarakat akan pelayanan<br />kesehatan yang lebih baik, pada tahun 1980 ditingkatkan statusnya menjadi<br />Puskesmas yang kemudian ditingkatkan menjadi Puskesmas dengan fasilitas<br />sederhana dan alat kesehatan yang tidak memadai 20 Juli 1986 meresmikan<br />Rumah Saki Siti Hajar Medan, sebagai salah satu Puskesmas. RS di Sumatera<br />Utara, siap memberikan pelayanan kesehatan dan menyediakan sarana dan<br />fasilitas kesehatan yang lebih lengkap<br /><br />RSU SITI HAJAR merupakan rumah sakit terakreditasi tipe C yang merupakan<br />rumah sakit tertua di kota Medan yang melayani pasien dari berbagai daerah.');
INSERT INTO `foto` VALUES (34, 41, 'Rumah Sakit Islam Asshobirin', '36asshobirin.jpg', 'Rumah Sakit Islam Asshobirin merupakan rumah sakit umum yang dikelola oleh Yayasan<br />Muslimin Tangerang.<br /><br />Rumah sakit ini berdiri sejak tahun 1992 dan merupakan salah satu Rumah Sakit Islam di Kota<br />Tangerang Selatan yang melayani masyarakat umum, peserta Jamsostek dan peserta Askes.<br /><br />Memiliki luas wilayah 15.373 m&sup2; dan luas bangunan sekitar 1.500 m&sup2;, Rumah Sakit Islam<br />Asshobirin tergolong rumah sakit tipe C. Sebagai salah satu pelayanan kesehatan di wilayah<br />Tangerang, Rumah Sakit Islam Asshobirin juga memiliki berbagai fasilitas pelayanan yang telah<br />dikembangkan seiring dengan semakin banyaknya pesatnya perkembangan ilmu pengetahuan<br />dan teknologi kedokteran dengan kebutuhan masyarakat.<br /><br />Selain fasilitas yang memadai, rumah sakit ini juga telah didukung oleh dokter ahli dari berbagai<br />disiplin ilmu serta dilengkapi dengan peralatan &amp; perangkat kesehatan terbaik, sehingga RS Islam<br />Asshobirin kini siap memberikan pelayanan terbaik kepada pasiennya.');
