INSERT INTO `halaman_statis` VALUES (1, 'FAQ', '?module=portofolio', '<div class=\"container-fluid\">\r\n<p><strong>Butik Kitchen</strong>&nbsp;: Salah satu unit usaha PT. Creativo Inti Corpora yang bergerak di bidang Pengadaan Commercial Kitchen Equipment, Instalasi Pipa Gas dan Alarm System serta Instalasi Ducting Exhaust &amp; Freshair.</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p><a href=\"https://butik-kitchen.com/\"><img src=\"https://1.bp.blogspot.com/-607lnuuYmOs/Xrzjso3Le4I/AAAAAAAAAes/s5b2nI9fF7UYolZpfKKM5h80X9Rlvst_wCK4BGAsYHg/w400-h188/first-banner.jpg\" alt=\"\" /></a></p>\r\n<p>&nbsp;</p>\r\n<p>Bagi Anda yang akan membuka restoran,&nbsp;<strong>instalasi pipa gas restoran, fabrikasi kitchen equipment stainless&nbsp;</strong>serta<strong>&nbsp;instalasi ducting exhaust dan fresh air</strong>&nbsp;merupakan hal yang sama pentingnya dengan strategi bisnis cemerlang maupun resep masakan yang lezat.</p>\r\n<p>&nbsp;</p>\r\n<p>Terlebih bagi Anda yang memiliki restoran besar dengan ratusan pengunjung tiap harinya dan ribuan masakan yang harus Anda buat, memiliki dapur dengan sirkulasi udara yang baik dan peralatan yang tahan lama akan bisa membuat pekerjaan Anda lebih efisien dan hemat biaya.</p>\r\n<p>&nbsp;</p>\r\n<p><strong><a href=\"https://butik-kitchen.com/\"><img src=\"https://1.bp.blogspot.com/-7e3RqkDJGcg/XsgSEnHyPXI/AAAAAAAAAgs/xSGsdGS-LH83g_y1md5chCavhS8TvT3xACK4BGAsYHg/s320/slider-1.jpg\" alt=\"\" /></a></strong></p>\r\n<p>&nbsp;</p>\r\n<p>Pertanyaan utamanya, bagaimana menemukan instalasi pipa gas restoran, fabrikasi kitchen equipment stainless hingga instalasi ducting exhaust dan fresh air<strong>&nbsp;</strong>yang tepat?</p>\r\n<p>&nbsp;</p>\r\n<p>Ini adalah mengenai dapur restoran Anda, lokasi produksi utama dari makanan yang akan Anda sajikan kepada konsumen, sehingga tentu saja Anda tidak bisa sembarang memilih penyedia jasa.</p>\r\n<p>&nbsp;</p>\r\n<p>kami juga menyediakan jasa pembuatan&nbsp;<strong>Kitchen Set Stainless</strong>&nbsp;untuk dapur rumah kesayangan Anda.&nbsp;</p>\r\n<table>\r\n<tbody>\r\n<tr>\r\n<td><a href=\"https://1.bp.blogspot.com/-olTv3Pga5AA/YCP2ofkZMyI/AAAAAAAAAyE/BHaIf1xuQDIZR-Nh1WjdK9dMsvIukoC0QCLcBGAsYHQ/s259/gambar%2B2.jpg\"><img src=\"https://1.bp.blogspot.com/-olTv3Pga5AA/YCP2ofkZMyI/AAAAAAAAAyE/BHaIf1xuQDIZR-Nh1WjdK9dMsvIukoC0QCLcBGAsYHQ/s0/gambar%2B2.jpg\" alt=\"\" /></a></td>\r\n<td><a href=\"https://1.bp.blogspot.com/-Taeu-2hBFSA/YCP19YbHVtI/AAAAAAAAAx0/ytJym0KLS84-bYkCqvi172O8_nEp0EWFgCLcBGAsYHQ/s300/Kitchen%2Bset%2Bstainless%2Bsteel.jpg\"><img src=\"https://1.bp.blogspot.com/-Taeu-2hBFSA/YCP19YbHVtI/AAAAAAAAAx0/ytJym0KLS84-bYkCqvi172O8_nEp0EWFgCLcBGAsYHQ/s0/Kitchen%2Bset%2Bstainless%2Bsteel.jpg\" alt=\"\" /></a></td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p><strong>Perlu DESIGN&nbsp;menarik yang cocok&nbsp;untuk dapur Anda ???&nbsp;</strong></p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<hr />\r\n<p><strong><span style=\"text-decoration: underline;\">Promo Product</span></strong></p>\r\n<p>&nbsp;</p>\r\n<p>1. Gas Deep Fryer</p>\r\n<p><strong><s>Rp. 1.700.000</s>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; Rp. 1.200.000</strong></p>\r\n<p><a href=\"https://1.bp.blogspot.com/-EJTL0Yy08X8/X_ViumhIMSI/AAAAAAAAAxE/LXt9zgBftBgx79X8vh2M2lyYYCDm2l1kwCLcBGAsYHQ/s700/Harga%2BDeep%2BFryer.jpg\"><img src=\"https://1.bp.blogspot.com/-EJTL0Yy08X8/X_ViumhIMSI/AAAAAAAAAxE/LXt9zgBftBgx79X8vh2M2lyYYCDm2l1kwCLcBGAsYHQ/s320/Harga%2BDeep%2BFryer.jpg\" alt=\"\" /></a></p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>2. Harga Promo Pemanggang :</p>\r\n<p><strong><s>Rp.2.100.000</s>&nbsp; &nbsp; &nbsp; &nbsp;Rp. 1.650.000</strong></p>\r\n<p><a href=\"https://1.bp.blogspot.com/-9QGGg77mVkI/X_Vi2FGMFYI/AAAAAAAAAxI/2HaG91yLnpkwlwgYlTfIVoBqwDOcGPxDACLcBGAsYHQ/s700/Harga%2BGrill.jpg\"><img src=\"https://1.bp.blogspot.com/-9QGGg77mVkI/X_Vi2FGMFYI/AAAAAAAAAxI/2HaG91yLnpkwlwgYlTfIVoBqwDOcGPxDACLcBGAsYHQ/s320/Harga%2BGrill.jpg\" alt=\"\" /></a></p>\r\n<p>&nbsp;</p>\r\n<hr />\r\n<p>&nbsp;</p>\r\n<p><strong><strong>Instalasi Pipa Gas Restoran</strong>&nbsp;</strong></p>\r\n<p><a href=\"https://1.bp.blogspot.com/-gnKbAVhU0Bo/X-tDk-96-VI/AAAAAAAAAuY/nTbhlEF8r4wVCebPaS_BUcQv7mQzZ4kzwCLcBGAsYHQ/s1032/central%2Bgas%2Bcatering%2Bpondok%2Bbambu.jpg\"><img src=\"https://1.bp.blogspot.com/-gnKbAVhU0Bo/X-tDk-96-VI/AAAAAAAAAuY/nTbhlEF8r4wVCebPaS_BUcQv7mQzZ4kzwCLcBGAsYHQ/s320/central%2Bgas%2Bcatering%2Bpondok%2Bbambu.jpg\" alt=\"\" /></a></p>\r\n<p>&nbsp;</p>\r\n<p>Selain fabrikasi kitchen equipment stainless steel, instalasi pipa gas restoran juga jadi hal yang penting untuk dapur restoran Anda.</p>\r\n<p>&nbsp;</p>\r\n<p>Bayangkan berapa kebutuhan gas restoran Anda dalam sehari untuk memasak ratusan masakan? Sangat tidak mungkin meletakan tabung gas puluhan liter di dalam dapur.</p>\r\n<p>&nbsp;</p>\r\n<p>Bukan hanya membuat ruang dapur sempit dan mobilitas semakin terganggu, namun juga sangat berbahaya dan bisa menimbulkan resiko ledakan apabila tanpa sengaja gas terpapar api dari kompor.</p>\r\n<p>Nah, disinilah instalasi pipa gas restoran wajib dilakukan.</p>\r\n<p>&nbsp;</p>\r\n<p>Dengan memisahkan gas sentral dari area dapur, dihubungkan dengan pipa berkualitas, resiko-resiko tersebut diatas dapat dihindari.</p>\r\n<p>Selain itu, pergantian gas pun akan relatif lebih mudah karena terpisah dari ruang dapur yang tiap harinya digunakan untuk memasak.</p>\r\n<p>&nbsp;</p>\r\n<blockquote>\r\n<p>Bagaimana cara memilih jasa instalasi pipa gas restoran yang tepat?</p>\r\n</blockquote>\r\n<p>Jangan main-main dalam memilih penyedia instalasi pipa gas restoran. Ini menyangkut keselamatan kerja karyawan Anda sekaligus keamanan restoran Anda.</p>\r\n<p>Oleh karena itu, pastikan penyedia jasa instalasi pipa gas restoran telah berpengalaman dan menggunakan material terbaik ketika melakukan instalasi.</p>\r\n<p>&nbsp;</p>\r\n<p>Butik Kitchen sendiri telah berpengalaman lebih dari 10 tahun di bidang ini. Dengan anggota tim yang handal di bidangnya masing-masing, kami paham betul bahan dan desain instalasi pipa gas restoran yang sesuai standar dan sempurna untuk bisnis Anda.</p>\r\n<p><strong><a href=\"https://butik-kitchen.com/\"><img src=\"https://1.bp.blogspot.com/-W5ucpQh29FQ/XsgWULNB0nI/AAAAAAAAAhg/sTtXTXhjMGAW8oWLruzkJoJAHcX-Cw0TwCK4BGAsYHg/s320/slider-3.jpg\" alt=\"\" /></a></strong></p>\r\n<p><strong>&nbsp;</strong></p>\r\n<p><strong><strong>Pemasangan Instalasi Pipa Gas LPG</strong></strong></p>\r\n<p>Pemasangan Instalasi Gas Ini, ada hal yang sangat penting di perhatikan secara khusus, antara lain adalah yang berhubungan dengan kualitas pipa untuk saluran gas, peralatan keamanan tambahan dan Regulator untuk menurunkan tekanan gas harus sesuai dengan spesifikasi peralatan. kualitas bahan yang berkualitas rendah, atau memiliki kualitas ketahanan rendah, sehingga dapat mengakibatkan banyak hal seperti kebocoran gas, tekanan tidak sesuai atau yang lainnya. untuk itu diperlukan tenaga khusus dan berpengalaman dalam hal instalasi pipa gas ini.</p>\r\n<p>&nbsp;</p>\r\n<p><strong><a href=\"https://www.blogger.com/blog/post/edit/3053398573098941087/3872170464233593361\"><img src=\"https://4.bp.blogspot.com/-JGOBZhNln0U/WEJtDaksGrI/AAAAAAAAAIo/V8LiIFkDLukMfsBwd5X8LtdlEtHLgF08ACLcB/s320/IMG_20130529_082649.jpg\" alt=\"\" /></a></strong></p>\r\n<p>&nbsp;</p>\r\n<p><strong><strong>Cara Menentukan Ukuran yang Di butuhkan&nbsp;</strong></strong></p>\r\n<p>Pipa besi yang digunakan adalah pipa besi Seamless yang tidak mengandung sambungan di dalamnya dan memiliki Schedule 40 dengan ketebalan 4mm. pipa ini dipasang mulai dari tabung gas atau gas meter sampai ke area dapur dengan cara pengelas pipa. Instalasi ini di lengkapi dengan Regulator dan Pressure Gas sebagai penunjuk tekanan dan Alarm Detector Gas sebagai pendeteksi kebocoran serta Selenoid yang akan menutup gas secara otomatis apabila terdapat kebocoran. ukuran diameter pipa juga disesuaikan dengan volume gas yang akan digunakan tergantung pada banyaknya jumlah kompor dan tekanan gas yang digunakan pada kompor.</p>\r\n<p>&nbsp;</p>\r\n<p>Tekanan ini dapat di bedakan menjadi 3 yaitu :</p>\r\n<ul>\r\n<li><strong>Low Pressure</strong>&nbsp; &nbsp; &gt; Tekanan yang biasa dipakai pada kompor rumah tangga atau kompor restoran yang tidak memerlukan api besar atau panas tinggi.</li>\r\n<li><strong>Medium Pressure</strong>&nbsp;&gt; Tekanan sedang untuk kompor kecil namun memerlukan kecepatan dan panas lebih tinggi.</li>\r\n<li><strong>High Pressure</strong>&nbsp; &gt; Tekanan tinggi untuk kompor yang memerlukan api besar dan panas yang tinggi.</li>\r\n</ul>\r\n<p>&nbsp;</p>\r\n<hr />\r\n<p><strong><strong>Instalasi Ducting Exhaust dan Fresh Air</strong>&nbsp;Ideal untuk Restoran Anda</strong></p>\r\n<p>&nbsp;</p>\r\n<p><a href=\"https://1.bp.blogspot.com/-6ytmo87Mh5w/X-tXaoMcJoI/AAAAAAAAAvA/8DmUoOjj-98-3HaidC3cZIdR_qKtglx2ACLcBGAsYHQ/s1044/dapur%2Bcatering%2Bbesar.jpg\"><img src=\"https://1.bp.blogspot.com/-6ytmo87Mh5w/X-tXaoMcJoI/AAAAAAAAAvA/8DmUoOjj-98-3HaidC3cZIdR_qKtglx2ACLcBGAsYHQ/w358-h213/dapur%2Bcatering%2Bbesar.jpg\" alt=\"\" /></a></p>\r\n<p>&nbsp;</p>\r\n<p>Bayangkan ketika Anda sedang memasak di dapur dan penghisap asap dapur Anda sedang mati? Tentu saja akan sangat mengganggu kegiatan memasak Anda dan bahkan membahayakan kesehatan Anda.</p>\r\n<p>Hal yang sama juga berlaku pada dapur restoran Anda. Sirkulasi udara yang buruk bisa mengganggu produktivitas karyawan Anda. Akibatnya, pelayanan pun akan menjadi tidak maksimal dan berujung pada menurunnya kepuasan pelanggan.</p>\r\n<p>Tenang saja, Butik Kitchen sudah berpengalaman di bidang ini selama bertahun-tahun, sehingga bisa melakukan instalasi ducting exhaust dan fresh air secara sempurna guna memberikan sirkulasi udara terbaik bagi dapur restoran Anda.</p>\r\n<p>Aliran udara baik, produktivitas kerja akan meningkat begitu pula dengan kualitas pelayanan Anda kepada pelanggan.</p>\r\n<p>Bagi Anda yang hendak melakukan instalasi pipa gas restoran, fabrikasi kitchen equipment stainless hingga instalasi ducting exhaust dan fresh air, Butik Kitchen bisa jadi pilihan penyedia jasa terbaik untuk restoran Anda.</p>\r\n<p>Dengan pengalaman lebih dari 10 tahun, puluhan anggota tim ahli ditambah penggunaan material berkualitas tinggi, dijamin dapur Anda akan membawa restoran Anda menuju kesuksesan.</p>\r\n<p><strong>&nbsp;</strong></p>\r\n<p><strong><a href=\"https://butik-kitchen.com/\"><img src=\"https://1.bp.blogspot.com/-g9-DzBYzc5g/XsgUsYzSpGI/AAAAAAAAAhE/St9M3vIn3KMs3sBi3K-prCpjr-PnUWoHwCK4BGAsYHg/s320/sawangan%2Bresto.jpg\" alt=\"\" /></a></strong></p>\r\n<hr />\r\n<p><strong><strong>Fabrikasi Kitchen Equipment Stainless</strong>&nbsp;Terbaik untuk Restoran Anda</strong></p>\r\n<p>Peratalan dapur stainless steel adalah pilihan terbaik bagi restoran Anda. Stainless steel merupakan bahan yang memiliki tekstur rata dan berpori kecil sehingga mudah dibersihkan. Sementara itu, peralatan dapur stainless steel juga tahan lama, tidak mudah karat dan tidak mudah rusak.</p>\r\n<p>Tentu saja karakter ini sempurna untuk peralatan dapur yang rentan terkena air, panas hingga benturan ketika proses memasak dilakukan.</p>\r\n<p>&nbsp;</p>\r\n<p><strong><a href=\"https://butik-kitchen.com/\"><img src=\"https://1.bp.blogspot.com/-7e3RqkDJGcg/XsgSEnHyPXI/AAAAAAAAAgs/xSGsdGS-LH83g_y1md5chCavhS8TvT3xACK4BGAsYHg/s320/slider-1.jpg\" alt=\"\" /></a></strong></p>\r\n<p>&nbsp;</p>\r\n<p>Nah, bagaimana untuk memastikan bahwa fabrikasi kitchen equipment stainless steel dapur Anda tidak abal-abal alias menggunakan bahan stainless steel murahan yang mudah berkarat?</p>\r\n<p>Sejak tahun 2010, Butik Kitchen telah melayani ratusan industri mulai dari hotel, restoran,Catering hingga bakery dalam proyek fabrikasi kitchen equipment stainless steel mereka.</p>\r\n<p>Menggunakan material plat stainless steel 201 dan 304, dapur Anda dijamin akan memiliki peralatan stainless steel terbaik yang dapat mendukung produktivitas kerja karyawan Anda.</p>\r\n<p>Kami bisa menyediakan peralatan dapur terbaik sesuai desain yang Anda berikan. Tidak memiliki bayangan desain?&nbsp; Kami juga mampu memberikan desain peralatan yang sesuai untuk infrastruktur dan kebutuhan dapur Anda.</p>\r\n<p>&nbsp;</p>\r\n<p><strong>&nbsp;&nbsp;</strong><a href=\"https://1.bp.blogspot.com/-Iw1_BAwtDcs/X-tSwzhiFRI/AAAAAAAAAus/5_Yu6qJlXKkcEHoCIqvqn5qN2ZtzRz2GQCLcBGAsYHQ/s1362/view%2B4.jpg\"><img src=\"https://1.bp.blogspot.com/-Iw1_BAwtDcs/X-tSwzhiFRI/AAAAAAAAAus/5_Yu6qJlXKkcEHoCIqvqn5qN2ZtzRz2GQCLcBGAsYHQ/w373-h199/view%2B4.jpg\" alt=\"\" /></a></p>\r\n<p>&nbsp;</p>\r\n<p><a href=\"https://1.bp.blogspot.com/-6vIR_6SD-AY/X_Jg7gAl4MI/AAAAAAAAAwM/5WXqTsvhWU0QOprHb5v3nkiVSl_bZBwGwCLcBGAsYHQ/s1239/Layout%2B2%2Bdimensi%2BKitchen%2BEquipment%252C%2BInstalasi%2BDucting%2Bexhaust%2BRUko%2BGolf%2BIsland%2B2.jpg\"><img src=\"https://1.bp.blogspot.com/-6vIR_6SD-AY/X_Jg7gAl4MI/AAAAAAAAAwM/5WXqTsvhWU0QOprHb5v3nkiVSl_bZBwGwCLcBGAsYHQ/s320/Layout%2B2%2Bdimensi%2BKitchen%2BEquipment%252C%2BInstalasi%2BDucting%2Bexhaust%2BRUko%2BGolf%2BIsland%2B2.jpg\" alt=\"\" /></a></p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>Kami juga menyediakan jasa konsultasi GRATIS untuk desain dapur Anda. Hubungi nomor 0813-1587-5925 atau email ke&nbsp;<a href=\"mailto:butikkitchen@gmail.com\">butikkitchen@gmail.com</a>&nbsp;dan wujudkan dapur restoran impian Anda sekarang juga!</p>\r\n</div>', 'Y');
