INSERT INTO `produk` VALUES (72, 36, 16, 'FORTUNER 2.7 SRZ 4X2 A/T BSN LUX GR SPORT', 'fortuner-27-srz-4x2-at-bsn-lux-gr-sport', '<h1 class=\"\"><span style=\"vertical-align: inherit;\"><span style=\"vertical-align: inherit;\">Beyond Exterior</span></span></h1>\r\n<div><span style=\"vertical-align: inherit;\"><span style=\"vertical-align: inherit;\">One of the strongest model with complete primary specification and is powered with a 4x4 function</span></span></div>\r\n<div>\r\n<p class=\"mb-1 mt-4 text-600\"><span style=\"vertical-align: inherit;\"><span style=\"vertical-align: inherit;\">Highlight Features</span></span></p>\r\n<div class=\"mb-1 d-flex\">\r\n<div class=\"px-2\"><span style=\"vertical-align: inherit;\"><span style=\"vertical-align: inherit;\">Dauntless New Front Bumper Spoiler &amp; Grille (GR Sport Type) with LED Headlamp &amp; Foglamp (All Type)</span></span></div>\r\n</div>\r\n<div class=\"mb-1 d-flex\">\r\n<div class=\"px-2\"><span style=\"vertical-align: inherit;\"><span style=\"vertical-align: inherit;\">New Elegant Rear Bumper Spoiler (GR Sport Type)</span></span></div>\r\n</div>\r\n<div class=\"mb-1 d-flex\">\r\n<div class=\"px-2\"><span style=\"vertical-align: inherit;\"><span style=\"vertical-align: inherit;\">New Dashing Alloy Wheel (GR Sport Type)</span></span></div>\r\n</div>\r\n<div class=\"mb-1 d-flex\">\r\n<div class=\"px-2\"><span style=\"vertical-align: inherit;\"><span style=\"vertical-align: inherit;\">Kick Sensor with Power Backdoor (GR Sport, VRZ Type)</span></span></div>\r\n</div>\r\n<div class=\"mb-1 d-flex\">\r\n<div class=\"px-2\"><span style=\"vertical-align: inherit;\"><span style=\"vertical-align: inherit;\">New GR Grade Emblem (2.8 GR Sport Type)</span></span></div>\r\n</div>\r\n<div class=\"mb-1 d-flex\">\r\n<div class=\"px-2\"><span style=\"vertical-align: inherit;\"><span style=\"vertical-align: inherit;\">New GR Side Sticker (GR Sport Type)</span></span><br /><br />\r\n<h1><span style=\"vertical-align: inherit;\"><span style=\"vertical-align: inherit;\">Beyond Interior</span></span></h1>\r\n<div>\r\n<p><span style=\"vertical-align: inherit;\"><span style=\"vertical-align: inherit;\">The world Dominators. </span><span style=\"vertical-align: inherit;\">The combination of strength, sport appearance and elegant design at the same time makes its performance stunning on all terrains.</span></span></p>\r\n</div>\r\n<div>\r\n<p class=\"mb-1\"><span style=\"vertical-align: inherit;\"><span style=\"vertical-align: inherit;\">Highlight Features</span></span></p>\r\n<div class=\"mb-1 d-flex\">\r\n<div class=\"px-2\"><span style=\"vertical-align: inherit;\"><span style=\"vertical-align: inherit;\">New Sporty Interior Design (GR Sport Type)</span></span></div>\r\n</div>\r\n<div class=\"mb-1 d-flex\">\r\n<div class=\"px-2\"><span style=\"vertical-align: inherit;\"><span style=\"vertical-align: inherit;\">New GR Opening (GR Sport Type) on Advanced 9\" Head Unit Display (GR Sport Type, VRZ Type)</span></span></div>\r\n</div>\r\n<div class=\"mb-1 d-flex\">\r\n<div class=\"px-2\"><span style=\"vertical-align: inherit;\"><span style=\"vertical-align: inherit;\">New GR Steering Wheel (GR Sport Type)</span></span></div>\r\n</div>\r\n<div class=\"mb-1 d-flex\">\r\n<div class=\"px-2\">New GR Engine Start/Stop Button&nbsp;(GR Sport Type)</div>\r\n</div>\r\n<div class=\"mb-1 d-flex\">\r\n<div class=\"px-2\">New GR Headrest Cover (GR Sport Type)</div>\r\n</div>\r\n<div class=\"mb-1 d-flex\">\r\n<div class=\"px-2\">New Adaptable Auto A/C with Dual Zone&nbsp;(All Type)<br /><br /><br /></div>\r\n</div>\r\n</div>\r\n<div class=\"wow fadeInRight px-3 px-md-5 col-md-6 mx-auto my-auto text-left\" data-wow-delay=\"0.2s\">\r\n<h1>Beyond Performance</h1>\r\n<div>\r\n<p>Conquer the road with outstanding performance, more power and fuel efficiency.</p>\r\n</div>\r\n<div>\r\n<p class=\"mb-1\">Highlight Features</p>\r\n<div class=\"mb-1 d-flex\">\r\n<div class=\"px-2\">New 1GD Engine (2.8 Diesel of : 4x4 &amp; 4x2 GR Sport, 4x2 VRZ)</div>\r\n</div>\r\n<div class=\"mb-1 d-flex\">\r\n<div class=\"px-2\">Easy 4x4 Switch (4x4 GR Sport Type)</div>\r\n</div>\r\n</div>\r\n</div>\r\n<div class=\"col-md-6\">\r\n<div class=\"d-md-block d-sm-none d-none\"><br /><br />\r\n<div class=\"wow fadeInRight px-3 px-md-5 col-md-6 mx-auto my-auto text-left\" data-wow-delay=\"0.2s\">\r\n<h1>Beyond Connected</h1>\r\n<div>\r\n<p>An integrated solution that you can access through mToyota application. Giving you comfort, providing peace of mind&nbsp;and always get connected to your car.</p>\r\n<p><strong>Highlight Features</strong></p>\r\n<ul>\r\n<li>Find My Car (All&nbsp;Type)</li>\r\n<li>Geofencing (All&nbsp;Type)</li>\r\n<li>E-Care (Maintenance) (All Type)</li>\r\n<li>Inquiry &amp; Support Center (All Type)</li>\r\n<li>Trip Driving Update (All Type)</li>\r\n<li>Road Assistance (All Type)</li>\r\n</ul>\r\n</div>\r\n</div>\r\n<div class=\"col-md-6\">\r\n<div class=\"d-md-block d-sm-none d-none\"><br />\r\n<h1>Beyond Accessories</h1>\r\n<div>\r\n<p>Customization items for all types may vary depending on the products and areas.</p>\r\n<p><strong>Highlight Features</strong></p>\r\n<ul>\r\n<li>Engine Hood List Chrome</li>\r\n<li>Outer Mirror Ornament</li>\r\n<li>Side Body Moulding</li>\r\n<li><span style=\"vertical-align: inherit;\"><span style=\"vertical-align: inherit;\">Rear License Ornament</span></span></li>\r\n<li><span style=\"vertical-align: inherit;\"><span style=\"vertical-align: inherit;\">Rear Bumper Ornament</span></span></li>\r\n<li><span style=\"vertical-align: inherit;\"><span style=\"vertical-align: inherit;\">Cargo Net</span></span></li>\r\n<li><span style=\"vertical-align: inherit;\"><span style=\"vertical-align: inherit;\">Spare Tire Cover</span></span></li>\r\n<li><span style=\"vertical-align: inherit;\"><span style=\"vertical-align: inherit;\">Sporty Floor Mat</span></span></li>\r\n<li><span style=\"vertical-align: inherit;\"><span style=\"vertical-align: inherit;\">Air Purifier</spa