INSERT INTO `produk` VALUES (74, 35, 16, 'SIENTA 1.5 V CVT (WELCAB DISABILITY)', 'sienta-15-v-cvt-welcab-disability', '<h1 class=\"\"><span style=\"vertical-align: inherit;\"><span style=\"vertical-align: inherit;\">Beyond Exterior</span></span></h1>\r\n<div><span style=\"vertical-align: inherit;\"><span style=\"vertical-align: inherit;\">With a modern concept, active and fun will make anyone want to feel the sensation of fun to drive with the Toyota New Sienta.</span></span></div>\r\n<div>\r\n<p class=\"mb-1 mt-4 text-600\"><span style=\"vertical-align: inherit;\"><span style=\"vertical-align: inherit;\">Highlight Features</span></span></p>\r\n<div class=\"mb-1 d-flex\">\r\n<div class=\"px-2\"><span style=\"vertical-align: inherit;\"><span style=\"vertical-align: inherit;\">New Front Grille &amp; Bumper Spoiler Design</span></span></div>\r\n</div>\r\n<div class=\"mb-1 d-flex\">\r\n<div class=\"px-2\"><span style=\"vertical-align: inherit;\"><span style=\"vertical-align: inherit;\">Bi-Beam LED Projector Headlamp with LED Clearence Lamp</span></span></div>\r\n</div>\r\n<div class=\"mb-1 d-flex\">\r\n<div class=\"px-2\"><span style=\"vertical-align: inherit;\"><span style=\"vertical-align: inherit;\">LED Rear Combination Lamp with LED Line Guide</span></span></div>\r\n</div>\r\n<div class=\"mb-1 d-flex\">\r\n<div class=\"px-2\"><span style=\"vertical-align: inherit;\"><span style=\"vertical-align: inherit;\">New Rear Spoiler Design</span></span></div>\r\n</div>\r\n<div class=\"mb-1 d-flex\">\r\n<div class=\"px-2\"><span style=\"vertical-align: inherit;\"><span style=\"vertical-align: inherit;\">Power Sliding Door</span></span><br /><br />\r\n<h1><span style=\"vertical-align: inherit;\"><span style=\"vertical-align: inherit;\">Beyond Interior</span></span></h1>\r\n<div>\r\n<p>Dalam balutan desain interior yang modern, sophisticated and comfort, Toyota New Sienta menjadi jawaban atas semua keinginan Anda akan kendaraan yang nyaman dan fungsional.</p>\r\n</div>\r\n<div>\r\n<p class=\"mb-1\">Highlight Features</p>\r\n<div class=\"mb-1 d-flex\">\r\n<div class=\"px-2\">New Burgundy Interior Color</div>\r\n</div>\r\n<div class=\"mb-1 d-flex\">\r\n<div class=\"px-2\">New 1st&nbsp;Row Armrest</div>\r\n</div>\r\n<div class=\"mb-1 d-flex\">\r\n<div class=\"px-2\">New 2nd Row Armrest</div>\r\n</div>\r\n<div class=\"mb-1 d-flex\">\r\n<div class=\"px-2\">New Premium 6.8\" AVX Touch Screen Head Unit</div>\r\n</div>\r\n<div class=\"mb-1 d-flex\">\r\n<div class=\"px-2\">Optitron Combination Meter with 4.2\" TFT Screen Mid</div>\r\n</div>\r\n<div class=\"mb-1 d-flex\">\r\n<div class=\"px-2\">Leather Steering Wheel with Steering Switch<br /><br />\r\n<h1 class=\"\">Beyond Safety</h1>\r\n<div>\r\n<p>Tidak hanya tampil dengan desain elegan, New Sienta juga hadir dengan fitur-fitur keselamatan yang mampu menjamin keselamatan pengendara dan penumpang selama perjalanan.</p>\r\n</div>\r\n<div>\r\n<p class=\"mb-1\">Highlight Features</p>\r\n<div class=\"mb-1 d-flex\">\r\n<div class=\"px-2\">Dual SRS Airbags &amp; Knee Airbag</div>\r\n</div>\r\n<div class=\"mb-1 d-flex\">\r\n<div class=\"px-2\">Hill-Start Assist (HSA)</div>\r\n</div>\r\n<div class=\"mb-1 d-flex\">\r\n<div class=\"px-2\">Vehicle Stability Control (VSC)</div>\r\n</div>\r\n<div class=\"mb-1 d-flex\">\r\n<div class=\"px-2\">Anti Lock Brake System</div>\r\n</div>\r\n<div class=\"mb-1 d-flex\">\r\n<div class=\"px-2\">Isofix<br /><br />\r\n<h1>Beyond Comfort</h1>\r\n<div>\r\n<p>Kabin yang luas hadirkan kenyamanan bagi seluruh penumpang saat berkendara.</p>\r\n</div>\r\n<div>\r\n<p class=\"mb-1\">Highlight Features</p>\r\n<div class=\"mb-1 d-flex\">\r\n<div class=\"px-2\">Spacious 7-Seater</div>\r\n</div>\r\n<div class=\"mb-1 d-flex\">\r\n<div class=\"px-2\">3rd Row Drive-in Seat<br /><br />\r\n<table id=\"tablepress-25\" class=\"tablepress tablepress-id-25 dataTable no-footer\" style=\"height: 144px; width: 308px;\" role=\"grid\">\r\n<thead>\r\n<tr class=\"row-1 odd\" style=\"height: 18px;\" role=\"row\">\r\n<th class=\"column-1 sorting_disabled\" style=\"height: 18px; width: 304px;\">TYPE</th>\r\n</tr>\r\n</thead>\r\n<tbody class=\"row-hover\">\r\n<tr class=\"row-2 even\" style=\"height: 54px;\" role=\"row\">\r\n<td class=\"column-1\" style=\"height: 54px; width: 304px;\"><span style=\"vertical-align: inherit;\"><span style=\"vertical-align: inherit;\">SIENTA 1.5 Q CVT </span></span><br /><span style=\"vertical-align: inherit;\"><span style=\"vertical-align: inherit;\">SIENTA 1.5 V CVT&nbsp; </span></span><br /><span style=\"vertical-align: inherit;\"><span style=\"vertical-align: inherit;\">SIENTA 1.5 V CVT WELCAB DISABILITY</span></span></td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>', 310200000, '50', 999.99, '2022-01-15', '93-super-white-min.png', 1, 0, 'Y');
INSERT INTO `produk` VALUES (75, 38, 16, 'YARIS 1.5 S CVT GR SPORT 7 Airbags', 'yaris-15-s-cvt-gr-sport-7-airbags', '<h1 class=\"\">Beyond Exterior</h1>\r\n<div>The new speedy hatchback that ready to excite the road as the sporty yet stylish design provides head-turning agility and persuasive sensation in every turn.</div>\r\n<div>\r\n<p class=\"mb-1 mt-4 text-600\">Highlight Features</p>\r\n<div class=\"mb-1 d-flex\">\r\n<div class=\"px-2\">Stunning New Front Bumper Spoiler</div>\r\n</div>\r\n<div class=\"mb-1 d-flex\">\r\n<div class=\"px-2\">Dashing LED Headlamp Design</div>\r\n</div>\r\n<div class=\"mb-1 d-flex\">\r\n<div class=\"px-2\">LED Fog Lamp Cover</div>\r\n</div>\r\n<div class=\"mb-1 d-flex\">\r\n<div class=\"px-2\">New Striking Rear Bumper Spoiler</div>\r\n</div>\r\n<div class=\"mb-1 d-flex\">\r\n<div class=\"px-2\">Dynamic Shark Fin Antenna</div>\r\n</div>\r\n<div class=\"mb-1 d-flex\">\r\n<div class=\"px-2\">New Rear Roof Spoiler<br /><br />\r\n<h1>Beyond Interior</h1>\r\n<div>\r\n<p>Prepare for the Toyota Yaris electrifying new model. Led by the new front look design and new high-end entertainment system that cause a head-turning situation in any way it performs.</p>\r\n</div>\r\n<div>\r\n<p class=\"mb-1\">Highlight Features</p>\r\n<div class=\"mb-1 d-flex\">\r\n<div class=\"px-2\">Sporty Interior Design With New Advanced Infotainment System</div>\r\n</div>\r\n<div class=\"mb-1 d-flex\">\r\n<div class=\"px-2\">New Advanced Infotainment System with GR Opening</div>\r\n</div>\r\n<div class=\"mb-1 d-flex\">\r\n<div class=\"px-2\">Leather New GR Steering Wheel with Audio &amp; TFT Switch</div>\r\n</div>\r\n<div class=\"mb-1 d-flex\">\r\n<div class=\"px-2\">New GR Push Start/Stop Button</div>\r\n</div>\r\n<div class=\"mb-1 d-flex\">\r\n<div class=\"px-2\">New GR Headrest Cover</div>\r\n</div>\r\n<div class=\"mb-1 d-flex\">\r\n<div class=\"px-2\">Rear Parking Camera<br /><br />\r\n<h1 class=\"\">Beyond Safety</h1>\r\n<div>\r\n<p>Maximum safety for every passenger to provide total peace of mind and excitement in every journey.</p>\r\n</div>\r\n<div>\r\n<p class=\"mb-1\">Highlight Features</p>\r\n<div class=\"mb-1 d-flex\">\r\n<div class=\"px-2\">7 Airbags (Driver + Passenger); 2 Side Airbags; 2 Curtain Side Airbags; Driver Knee</div>\r\n</div>\r\n<div class=\"mb-1 d-flex\">\r\n<div class=\"px-2\">Vehicle Stability Control (VSC)</div>\r\n</div>\r\n<div class=\"mb-1 d-flex\">\r\n<div class=\"px-2\">Hill-Start Assist (HSA)</div>\r\n</div>\r\n<div class=\"mb-1 d-flex\">\r\n<div class=\"px-2\">Anti-lock Braking System (ABS) + Electronic Braking Distribution (EBD) + Brake Assist (BA)</div>\r\n</div>\r\n<div class=\"mb-1 d-flex\">\r\n<div class=\"px-2\">Isofix with Tether Anchor</div>\r\n</div>\r\n<div class=\"mb-1 d-flex\">\r\n<div class=\"px-2\">Whiplash Injury Lessening Seat<br /><br />\r\n<h1>Beyond Accessories</h1>\r\n<div>\r\n<p>Customization items for all types may vary depending on the products and areas.</p>\r\n<p><strong>Highlight Features.</strong></p>\r\n<ul>\r\n<li>Sporty Floormat Set</li>\r\n<li>Air Purifier</li>\r\n</ul>\r\n<br />\r\n<table id=\"tablepress-25\" class=\"tablepress tablepress-id-25 dataTable no-footer\" style=\"height: 198px; width: 298px;\" role=\"grid\">\r\n<thead>\r\n<tr class=\"row-1 odd\" style=\"height: 18px;\" role=\"row\">\r\n<th class=\"column-1 sorting_disabled\" style=\"height: 18px; width: 294px;\">TYPE</th>\r\n</tr>\r\n</thead>\r\n<tbody class=\"row-hover\">\r\n<tr class=\"row-2 even\" style=\"height: 72px;\" role=\"row\">\r\n<td class=\"column-1\" style=\"height: 72px; width: 294px;\">YARIS 1.5 G CVT 3 Airbags&nbsp;<br />YARIS 1.5 S CVT GR SPORT 3 Airbags&nbsp;<br />YARIS 1.5 S CVT GR SPORT 7 Airbags&nbsp;<br />YARIS 1.5 S M/T GR SPORT 3 Airbags&nbsp;</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>', 290100000, '50', 999.99, '2022-01-15', '647-attitude-black-mica.png', 1, 0, 'Y');
INSERT INTO `profil` VALUES (1, '', 'logo.png', 'AUTO 2000 Jakarta', 'Jakarta', 'Dapat Mobil Idaman | DP dan Angsuran Rendah | Proses Cepat', 'AUTO 2000 Jakarta | Cash Credit | DP Ringan | Angsuran Ringan | Test Drive | Bonus Aksesories | Data di Bantu Sampai Approve hanya ada disini', 'tidak ada', '6285781571742', '<div class=\"row\">\r\n<div class=\"column\">\r\n<div class=\"landing-sub-heading\"><strong>Sekilas AUTO2000</strong></div>\r\n<div class=\"overview-content-container\">\r\n<div class=\"content\">\r\n<p class=\"overview-content landing-content-overview\" align=\"justify\">Auto2000 Digiroom merupakan transformasi baru dari website Auto2000.co.id yang kini menjadi e-commerce website untuk penjualan mobil, suku cadang, dan aksesoris resmi Toyota di Indonesia. Berawal dari jaringan jasa penjualan, perawatan, perbaikan dan penyediaan suku cadang Toyota yang berdiri sejak tahun 1975 dengan nama Astra Motor Sales, dan baru pada tahun 1989 berubah nama menjadi Auto2000 dengan manajemen yang sudah ditangani sepenuhnya oleh PT. Astra International Tbk.<br /><br />Dengan website baru Auto2000.co.id, Auto2000 berusaha mendorong batasan transaksi pembelian mobil Toyota di platform digital. Kini, pelanggan dapat melakukan pembelian kendaraan baru, purna jual, suku cadang, aksesoris, serta Trade In dan pembelian mobil bekas (bekerjasama dengan Astra Auto Trust) semudah menggerakkan jempol di layar smartphone. Menggunakan konsep &ldquo;seamless end-to-end customer experience&rdquo;, Auto2000 memastikan pelanggan merasakan pengalaman pelayanan di platform digital yang sama baiknya dengan yang diterima di cabang Auto2000.<br /><br />Tak hanya itu, aplikasi Auto2000 Mobile baru yang membantu pelanggan melakukan perawatan kendaraan Toyota menjadi semakin mudah, mulai dari pemesanan THS &ndash; Auto2000 Home Service, melacak status servis, hingga simulasi perhitungan pembiayaan (leasing).???????<br /><span lang=\"EN-US\"><span lang=\"IN\">Kami menyiapkan Auto2000&nbsp;</span>digiroom&nbsp;<span lang=\"IN\">sebagai layanan yang praktis seperti showroom Toyota di saku Anda.</span>&nbsp;Auto2000 digiroom adalah wujud komitmen kami kepada para pelanggan agar&nbsp;<strong>Urusan Toyota lebih mudah!</strong></span></p>\r\n</div>\r\n</div>\r\n</div>\r\n<div class=\"column\">\r\n<div class=\"landing-sub-heading\"><strong>Visi Kami</strong></div>\r\n<div class=\"overview-content-container\">\r\n<div class=\"content\">\r\n<p class=\"overview-content landing-content-overview\">Menjadi Dealer Toyota terbaik dan terandal di Indonesia melalui proses kelas dunia.</p>\r\n</div>\r\n</div>\r\n<div class=\"mission-sub-heading\"><strong>Misi Kami</strong></div>\r\n<div class=\"overview-content-container\">\r\n<div class=\"content\">\r\n<p class=\"overview-content landing-content-overview\">Membantu pelanggan menikmati mobilitasnya.</p>\r\n</div>\r\n</div>\r\n</div>\r\n</div>', '', '', '', '', '', 'http://localhost/auto2000jakarta/');
